import React from "react";
import {
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  Dot,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";
import "./SlickCard.css";

const SlickCard = () => {
  return (
    <CarouselProvider
      naturalSlideWidth={200}
      naturalSlideHeight={125}
      totalSlides={3}
      className="row"
    >
      <Slider>
        <Slide index={0}>
          <div className="image-box">
            <div className="inner-box">
              <ImageWithZoom className="image-box-img" />
            </div>
          </div>
        </Slide>
        <Slide index={1}>
          <div className="image-box">salom</div>
        </Slide>
        <Slide index={2}>
          <div className="image-box">salom</div>
        </Slide>
      </Slider>
      <div className="dots col s2">
        <Dot slide={0}>1</Dot>
        <Dot slide={1}>2</Dot>
        <Dot slide={2}>3</Dot>
      </div>
    </CarouselProvider>
  );
};

export default SlickCard;
